import React, { useState } from 'react';
import Calendar from 'react-calendar';
import 'react-calendar/dist/Calendar.css';  // Importing calendar styles
import PatientProfile from './PatientProfile'; // Import the new PatientProfile component
import './Dashboard.css';  // Your existing styles

const Dashboard = () => {
  const [date, setDate] = useState(new Date());
  const [selectedPatient, setSelectedPatient] = useState(null);

  const patients = [
    { name: 'Adam Messy', age: 26, sex: 'Male', visits: 5, note: '' },
    { name: 'Celine Aluista', age: 22, sex: 'Female', visits: 3, note: '' },
  ];

  const openPatientProfile = (patient) => {
    setSelectedPatient(patient);
  };

  const closePatientProfile = () => {
    setSelectedPatient(null);
  };

  return (
    <div className="container">
      <aside className="sidebar">
        <div className="logo">
          <h2>Mediczen™</h2>
        </div>
        <input type="search" placeholder="Search" />
        <nav>
          <ul>
            <li><a href="#">Patients</a></li>
            <li><a href="#">Billing</a></li>
          </ul>
          <h3>Support</h3>
          <ul>
            <li><a href="#">Help Center</a></li>
            <li><a href="#">Settings</a></li>
          </ul>
        </nav>
      </aside>

      <main className="main-content">
        <header className="dashboard-header">
          <div className="greeting">
            <h1>Good Morning, Dr. A!</h1>
            <p>I hope you're in a good mood because there are {patients.length} patients waiting for you</p>
          </div>
          <div className="profile">
            <img src="doctor-profile.jpg" alt="Doctor Profile" />
          </div>
        </header>

        <div className="content-wrapper">
          <section className="patients-section">
            <div className="patient-list-header">
              <h2>Patients</h2>
            </div>
            <table className="patients-table">
              <thead>
                <tr>
                  <th>Name (Age, Gender)</th>
                  <th>Token No.</th>
                </tr>
              </thead>
              <tbody>
                {patients.map((patient, index) => (
                  <tr key={index}>
                    <td>
                      <img src={`${patient.name.toLowerCase().replace(' ', '-')}.jpg`} alt={patient.name} />
                      {patient.name}<br />
                      {patient.sex}, {patient.age} Years
                    </td>
                    <td>
                      <button className="token-link" onClick={() => openPatientProfile(patient)}>#{"#"+(index + 1)}</button>
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>
          </section>

          {/* Calendar Section */}
          <section className="calendar-section">
            <Calendar 
              onChange={setDate} 
              value={date} 
              className="react-calendar" 
            />
            <p>Selected Date: {date.toDateString()}</p>
          </section>
        </div>

        {/* Render Patient Profile if selected */}
        {selectedPatient && (
          <PatientProfile 
            patient={selectedPatient} 
            onClose={closePatientProfile} 
          />
        )}
      </main>
    </div>
  );
};

export default Dashboard;
